import React from "react";

function Checkout() {
  return (
    <div>
      <h1>
        Thank you for exploring this demo website, more will be coming in the
        near future
      </h1>
      <h3>
        Future Goal is to develop login system with a full database being sent
        to the back-end. Additionally to this, the plan is to implement a
        inactive payment system to simulate full website.
      </h3>
    </div>
  );
}

export default Checkout;
